import React from "react";
import { Link } from "react-router-dom";

function OwlVideo(props) {
  return (
    <div className="item">
      <Link as={Link} to="/">
        <iframe
          width="100%"
          height="200"
          src={props.picture}
          title="YouTube video player"
          frameborder="0"
          allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
          allowfullscreen
        ></iframe>
      </Link>
      <div className="post-text">
        <h5 className="text-center" style={{ marginTop: "3px" }}>
          {props.title}
        </h5>
      </div>
    </div>
  );
}

export default OwlVideo;
